import React from 'react'
import './segunda.css'

function Segunda() {
    
    
    return(
        <div className="painel">
            <h1 className="comentario">Digite um comentario</h1>
            <input className="segunda" type="text"/>
            <h1 className="comentario">Digite um comentario</h1>
        </div>
        
    );
}
export default Segunda;
